import logo from './logo.svg';
import './App.css';
import GlobalApi from './GlobalApi';
import BookList from './bookList';


import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {

  return (

    <Router>
      <div className="App">
        <button onClick={GlobalApi.baseInfoUpload}>Upload</button>
        <Router path="/">
          <BookList />
        </Router>
      </div>
    </Router>



  );
}

export default App;
